import React from 'react'
import Header from '../../components/Header';
import Introduce from '../../components/UI/Introduce';

const Industries = () => {
    return (
        <>
            <Header Page={'industries'} />
            <main>
                <Introduce Page={'industries'} />
                <Industries />
            </main>
        </>

    )
}

export default Industries;
